import './SizeCard.css';

export default function SizeCard({ size }) {
  return (
    <li className='size-card'>
      <label for={size} className='size-label'>
        <input className='size-button' type='radio' name='size' value={size} id={size}/>
        <div>{size}</div>
      </label>
    </li>
  )
}
